ad other types of document: Code, Database, video, audio, etc. (Các thư mục Final Thesis chấp nhận các file phần mở rộng như 'doc', 'docx', 'pdf', 'xls', 'xlsx', 'jpg', 'jpeg', 'png', 'gif', 'pptx', 'txt', 'odt', 'ods', 'ppt'. Vui lòng di chuyển 'Others' để tải lên các loại tài liệu khác: Mã nguồn, CSDL, video, âm thanh…).\r\n",
